CREATE DATABASE IF NOT EXISTS bike_project;
USE bike_project;
DROP TABLE IF EXISTS bike_rides;
CREATE TABLE bike_rides (`ride_id` TEXT, `rideable_type` TEXT, `started_at` TEXT, `ended_at` TEXT, `drip_dur_min` TEXT, `is_weekend` TEXT, `start_station_name` TEXT, `start_station_id` TEXT, `end_station_name` TEXT, `end_station_id` TEXT, `start_lat` TEXT, `start_lng` TEXT, `end_lat` TEXT, `end_lng` TEXT, `member_casual` TEXT, `ride_date` TEXT, `start_hour` TEXT, `day_name` TEXT, `Column 19` TEXT);
SELECT COUNT(*) AS total_rides FROM bike_project.bike_rides
SELECT member_casual,
       COUNT(*) AS total_rides
FROM bike_project.bike_rides
GROUP BY member_casual;
SELECT day_name,
       COUNT(*) AS total_rides
FROM bike_project.bike_rides
GROUP BY day_name
ORDER BY total_rides DESC;
SELECT HOUR(started_at) AS hour,
       COUNT(*) AS total_rides
FROM bike_project.bike_rides
GROUP BY hour
ORDER BY total_rides DESC;
SELECT start_station_name,
       COUNT(*) AS total_rides
FROM bike_project.bike_rides
GROUP BY start_station_name
ORDER BY total_rides DESC
LIMIT 5;
